                            BALL_NUM2 INT NOT NULL,
                            BALL_NUM3 INT NOT NULL,
                            BALL_NUM4 INT NOT NULL,
                            BALL_NUM5 INT NOT NULL,
                            BALL_NUM6 INT NOT NULL,
